import './Nav.css'
import Logo from '../../Logo.png'
import NavItem from '../navItem/NavItem'

const Nav = () => {
    const navbarItems = ["Home","Men's", "Women's","Kid's","Pages","Features","Explore"];
    const navbarListItems = navbarItems.map((listItem , key) =>
    <NavItem id={key}><a href="#" class="nav-link">{listItem}</a></NavItem>
);

  return (
    <div class="nav-container">
    <div class="nav">
      <div class="nav-brand">
        <img src={Logo} />
      </div>
      <ul class="navbar-nav">{navbarListItems}</ul>
    </div>
  </div>
  )
}

export default Nav
